class Submission:
    def __init__(self, user, file):
        self.user = user
        self.file = file
        self.status = "pending"

    def submit(self):
        print(f"Submission {self.file} by {self.user.username} is pending")

    def update_status(self, status):
        self.status = status

class Validator:
    def __init__(self):
        self.rules = []

    def add_rule(self, rule):
        self.rules.append(rule)

    def validate(self, submission):
        for rule in self.rules:
            if not rule(submission):
                return False
        return True

